import React from 'react';
import dog from './dog.png';

const Boxes = ({ name }) => {
	return (
		<div className="black f4">
			{`${name}, pick your favorite pet and fill out an application`}
			<div className="card w-8">
    			<img className="card-img-top" src="dog" alt="Card image cap"></img>
    				<div className="card-body">
            			<h5 className="card-title">Heading 1</h5>
           				<p className="card-text">some text</p>
            			<a href="#" className="btn btn-primary">a button</a>
    				</div>
			</div>

			<div className="card">
    			<img className="card-img-top" src="dog" alt="Card image cap"></img>
    				<div className="card-body">
            			<h5 className="card-title">Heading 2</h5>
            			<p className="card-text">some text</p>
            			<a href="#" className="btn btn-primary">a button</a>
    				</div>
			</div>
		</div>
	);
}

export default Boxes;
